import React from 'react';
import './App.css';

import SearchBar from '../SearchBar/SearchBar.js';
import SearchResults from '../SearchResults/SearchResults';
import Playlist from '../Playlist/Playlist';

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      searchResults: [
      {name: 'name1', artist: 'artist 1', album: 'album1', id: 1},
      {name: 'name2', artist: 'artist 2', album: 'album2', id: 2},
      {name: 'name3', artist: 'artist 3', album: 'album3', id: 3}
      ],
      playlistName: 'My Playlist',
      playlistTracks: [{name: 'playList_name1', artist: 'playList_artist 1', album: 'playList_album1', id: 1}]
    }
  }
  render() {
    return (
      <div>
        <h1>Ja<span className="highlight">mmm</span>ing</h1>
        <div className="App">
          <SearchBar />
          <div className="App-playlist">
            <SearchResults searchResults={this.state.searchResults}/>
            <Playlist />
          </div>
        </div>
      </div>
    )
  }
}

export default App;
